import { Link } from "react-router-dom";

const BlogList = ({blogs, title}) => {
   //const blog = props;

    return ( 
    <div className="newlist">
        <h2>{title}</h2>
                {blogs.map((blog) => (
                   <div className="blog-preview" key={blog.id}>
                    <Link to={`/blogs/$`}>
                    <h2>
                        {blog.title}
                    </h2>
                    <p>Written by {blog.author}</p>
                    </Link>

                   </div>
                ))}
    </div> 
    );
}

export default BlogList;
